import './App.css';
import React, { Component } from 'react';
import axios from "axios"



class App extends Component {
  state = {
    paises: []
  }

  componentDidMount() {
    axios
      .get('http://battuta.medunes.net/api/country/all/?key=c986ee6250b57d247844491490212d32')
      .then((response) => {
        console.log(response);
        this.setState({ paises: response.data })
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    return (

      <div class="container" >
        <div class="row">
          <div class="col-md-4 mx-auto p-4">
            <div class="card text-center">
              <div class="card-header">
                <h3>Form</h3>
              </div>
              <div class="card-body">
                <div>

                </div>
                <form action="" method="POST">
                  <div class="form-grup p-2">
                    <input type="text" name="fullname" placeholder="Fullname" class="form-control" autofocus />
                  </div>
                  <div class="form-grup p-2">
                    <input type="dropdown" name="coutrylist" placeholder="Select a Country" class="form-control" />
                  </div>
                  <div class="form-grup p-2">
                    <select name='paises' className='form-control'>
                      {this.state.paises.map(elemento => (
                        <option key={elemento.name} value={elemento.name}>{elemento.pais}</option>
                      )
                      )}
                    </select>
                  </div>
                  <div class="form-group p-2">
                    <button class="btn btn-success btn-block">
                      Send
                    </button>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
export default App;
